  async function getTexture(texture) {
    if (textures[texture].startsWith("data:image/png;base64,")) return textures[texture]
    const data = await new Promise(async fulfil => {
      const reader = new FileReader()
      reader.onload = e => fulfil(e.target.result)
      reader.readAsDataURL(new Blob([await fetch(textures[texture]).then(e => e.arrayBuffer())], { type: "image/png" }))
    }).catch(() => {})
    textures[texture] = data
    return data
  }

  async function addText(text, args) {
    const newCubes = []
    const newTextures = []
    Undo.initEdit({
      elements: newCubes,
      outliner: true,
      textures: newTextures
    })
    const texture = await makeTexture(args.texture, {
      text,
      hue: args.hue,
      blend: args.blend,
      colour: args.colour,
      customBorder: args.customBorder,
      customBorderColour: args.customBorderColour,
      fadeToBorder: args.fadeToBorder
    })
    newTextures.push(texture)
    const words = text.split(" ")
    let group
    let offset = 0
    if (words.length === 1) {
      [group] = makeWord(text, offset, "root", {
        texture: texture.uuid,
        row: args.row,
        type: args.type,
        characterSpacing: args.characterSpacing,
        rowSpacing: args.rowSpacing,
        scale: args.scale,
        newCubes
      })
    } else {
      group = new Group(makeName(text)).init()
      for (const part of words) {
        const [word, newOffset] = makeWord(part, offset, group, {
          texture: texture.uuid,
          row: args.row,
          type: args.type,
          characterSpacing: args.characterSpacing,
          rowSpacing: args.rowSpacing,
          scale: args.scale,
          newCubes
        })
        offset = newOffset + (8 + args.characterSpacing) * args.scale[0]
      }
    }
    group.addTo().select()
    let min = Infinity
    let max = -Infinity
    for (const cube of Cube.selected) {
      min = Math.min(min, cube.from[0], cube.to[0])
      max = Math.max(max, cube.from[0], cube.to[0])
    }
    const width = (max - min) / 2 + 8
    for (const cube of Cube.selected) {
      cube.from[0] += width
      cube.to[0] += width
    }
    if (args.type === "bottom") {
      group.rotation[0] = -90
    }
    Canvas.updateView({
      elements: Cube.selected,
      groups: [Group.selected]
    })
    Undo.finishEdit("Add Minecraft title text")
    updateSelection()

  }

  async function makeTexture(texture, args) {
    const img = (await new Promise(async fulfill => new THREE.TextureLoader().load(await getTexture(texture), fulfill, null, fulfill))).image
    const canvas = document.createElement("canvas")
    canvas.width = img.width
    canvas.height = img.height
    const ctx = canvas.getContext("2d")
    ctx.filter =`hue-rotate(${args.hue}deg)`
    ctx.drawImage(img, 0, 0)
    ctx.filter ="hue-rotate(0deg)"
    ctx.globalCompositeOperation = args.blend
    ctx.fillStyle = args.colour
    ctx.fillRect(0, 0, canvas.width, canvas.height)
    ctx.globalCompositeOperation = "destination-in"
    ctx.drawImage(img, 0, 0)
    const m = canvas.width / 1000
    if (args.customBorder) {
      ctx.globalCompositeOperation = "source-atop"
      ctx.fillStyle = args.customBorderColour
      ctx.fillRect(0, 266 * m, 60 * m, 22 * m)
    }
    if (args.fadeToBorder) {
      ctx.globalCompositeOperation = "source-atop"
      const border = ctx.getImageData(0, 266 * m, 1, 1).data
      const gradient = ctx.createLinearGradient(0, 0, 0, 264 * m)
      gradient.addColorStop(0, `rgb(${border[0]},${border[1]},${border[2]})`)
      gradient.addColorStop(22 / 264, `rgb(${border[0]},${border[1]},${border[2]},0)`)
      gradient.addColorStop(62 / 264, `rgb(${border[0]},${border[1]},${border[2]},0)`)
      gradient.addColorStop(84 / 264, `rgb(${border[0]},${border[1]},${border[2]})`)
      gradient.addColorStop(86 / 264, `rgb(${border[0]},${border[1]},${border[2]},0)`)
      gradient.addColorStop(86.5 / 264, `rgb(${border[0]},${border[1]},${border[2]})`)
      gradient.addColorStop(108 / 264, `rgb(${border[0]},${border[1]},${border[2]},0)`)
      gradient.addColorStop(148 / 264, `rgb(${border[0]},${border[1]},${border[2]},0)`)
      gradient.addColorStop(170 / 264, `rgb(${border[0]},${border[1]},${border[2]})`)
      gradient.addColorStop(172 / 264, `rgb(${border[0]},${border[1]},${border[2]},0)`)
      gradient.addColorStop(172.5 / 264, `rgb(${border[0]},${border[1]},${border[2]})`)
      gradient.addColorStop(194 / 264, `rgb(${border[0]},${border[1]},${border[2]},0)`)
      gradient.addColorStop(242 / 264, `rgb(${border[0]},${border[1]},${border[2]},0)`)
      gradient.addColorStop(1, `rgb(${border[0]},${border[1]},${border[2]})`)
      ctx.fillStyle = gradient
      ctx.fillRect(0, 0, 1000 * m, 264 * m)
    }
    if (args.three) {
      const texture = await new Promise(fulfil => new THREE.TextureLoader().load(canvas.toDataURL(), fulfil))
      texture.colorSpace = THREE.SRGBColorSpace
      texture.magFilter = THREE.NearestFilter
      return texture
    }
    return new Texture({ name: `${makeName(args.text)}.png` }).fromDataURL(canvas.toDataURL()).add()
  }

  function makeWord(text, offset, parent, args) {
    const word = new Group(makeName(text))
    word.addTo(parent).init()
    for (const char of text) {
      if (characters[char]) {
        const [character, width] = makeCharacter(char, offset, word, args)
        offset += width
      }
    }
    return [word, offset]
  }

  function makeCharacter(char, offset, parent, args) {
    let min = Infinity
    let max = -Infinity
    const cubes = []
    for (const element of characters[char]) {
      if (!element.parsed) {
        element.parsed = true
        for (const [direction, uv] of Object.entries(element.faces)) {
          element.faces[direction] = { uv }
        }
      }
      min = Math.min(min, element.from[0], element.to[0])
      max = Math.max(max, element.from[0], element.to[0])
      const cube = new Cube(element)
      cube.autouv = 0
      for (const key in cube.faces) {
        const readFace = element.faces[key]
        const newFace = cube.faces[key]
        if (readFace === undefined) {
          newFace.texture = null
          newFace.uv = [0, 0, 0, 0]
        } else {
          newFace.texture = args.texture
          newFace.uv.forEach((n, i) => {
            newFace.uv[i] = readFace.uv[i] * UVEditor.getResolution(i % 2) / 16
          })
        }
      }
      cubes.push(cube)
    }
    const character = new Group(makeName(char))
    character.addTo(parent).init()
    for (const cube of cubes) {
      cube.to[0] -= offset + max
      cube.from[0] -= offset + max
      if (args.type === "bottom") {
        cube.to[1] *= 1.75
        cube.from[1] *= 1.75
        cube.to[1] -= args.row * 84 + 86 + args.rowSpacing * args.row
        cube.from[1] -= args.row * 84 + 86 + args.rowSpacing * args.row
        if (cube.to[2] > cube.from[2]) {
          cube.to[2] += 20
        } else {
          cube.from[2] += 20
        }
      } else {
        cube.to[1] += args.row * 48 + args.rowSpacing * args.row
        cube.from[1] += args.row * 48 + args.rowSpacing * args.row
      }
      cube.to = cube.to.map((e, i) => e * args.scale[i])
      cube.from = cube.from.map((e, i) => e * args.scale[i])
      cube.addTo(character).init()
      args.newCubes.push(cube)
    }
    return [character, max - min + args.characterSpacing * args.scale[0]]
  }

  function makeName(str) {
    return str.replace(/\s/g, "_").replace(/ðŸ˜³/g, "a").replace(/ðŸ˜©/g, "'")
  }

  function selectHandler() {
    if (Mode.selected.id === "minecraft_title_render") Canvas.scene.traverseVisible(e => {
      if (e.type === "Line") e.visible = false
    })
  }
